import { GeoLocation } from "./Geolocation";
const APIBase = 'https://cors-anywhere.herokuapp.com/https://www.metaweather.com/api/location/';

export async function getConnection(id) {
    const API = `${APIBase}${id}/`
    try {
        const coords = GeoLocation.response;
        const response = await fetch(`https://cors-anywhere.herokuapp.com/https://www.metaweather.com/api/location/`);
        const data = await response.json();
        console.log(response);
        //console.log(data);
    } catch (error) {
        console.log('ERROR');
    }
}
